import React from "react";
import  styles from'./css/navbar.css';

const NavBar =({link})=>{
return(
    <div className="Navbar">
   <nav>
    <ul>
       {
        link.map((link,index)=>(
            <li key={index}>{link}</li>
        ))
       }
    </ul>
   </nav>
    </div>
)
}

export default NavBar;
